css:
@-moz-document domain("www.nitrotype.com")
{
  
body {
    background: none;
}
html {
    background: fixed url("https://cdn.discordapp.com/attachments/630836446822924290/729832060306325554/wampus_world_thing.png"), #001d45;
    background-size: 100%;
}
.bg--gradient {
    background: fixed;
}
.theme--pDefault .profile-bg
  {
    background: url("https://cdn.discordapp.com/attachments/638480171883692043/726144302824161350/test_3.gif") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #ffffff 100%);
    color: #d3d3d3;
    background-size: 100%
  }

  .theme--pDefault .profile-bgHead
  {
    background: url("https://cdn.discordapp.com/attachments/638480171883692043/726144302824161350/test_3.gif") top left repeat, linear-gradient(0deg, #2d2e2e 10%, #ffffff 100%);
   background-size: 100%
  }

  .theme--pDefault.is-gold .profile-bg
  {
    background: url("https://cdn.discordapp.com/attachments/638480171883692043/726144302824161350/test_3.gif") top left repeat, linear-gradient(0deg, #2d2e2e 10%, #ffffff 100%);
   background-size: 100%
  }
  .structure.theme--season28 
  {
      background-image: none;
  }

  .card--a
  {
    background-color: #fff0;
    color: #ffffff;
  }

  .card--shadow-l
  {
    box-shadow: none;
  }
  .theme--pDefault .profile-levelNum {
    color: #ffffff;
    text-shadow: 0 2px 2px rgba(2, 2, 2, 0.25);
}
.news--solo .news-body p {
    color: #ffffff;
    line-height: 1.8;
}
.news-teaser {
    color: #ffffff;
    margin-bottom: 40px;
}
.card--a {
    color: #ffffff;
    background: transparent;
}
.card--shadow-l {
    box-shadow: none;
}
.btn--inky {
    color: #fff;
}
.card--b {
    color: #fff;
}
.theme--pDefault .profile-body {
    color: #ffffff;
}
.card--grit {
    background: none;
}
.dash-copyContainer {
    background: #1d1e23;
    box-shadow: 0 1px 157px 10px rgba(0, 0, 0, 0.78);
}
.dash-copy {
    color: #2eb0e8;
    font-size: 28px;
}
}
